import React from "react";
import { NavLink } from "react-router-dom";
import './Nav.css'

const Nav = () => {
    return (
    <nav>
        <div>
            <NavLink to="/main">
                메인
            </NavLink>
        </div>
        <div>
            <NavLink to="/detail">
                데이터 상세 분석
            </NavLink>
        </div>
        <div>
            <NavLink to="/display">
                데이터 현황
            </NavLink>
        </div>
        <div>
            <NavLink to="/risk">
                위험도 분석
            </NavLink>
        </div>
    </nav>
    );
};

export default Nav;
